import React, { useState } from "react";
const Search = ({ setInputValue }) => {
  const [input, setInput] = useState("");
  return (
    <main class="container">
      <div class="search">
        <input
          type="text"
          id="countryInput"
          placeholder="Search by country"
          onChange={(event) => {
            setInput(event.target.value);
          }}
          required
        />
        <button
          onClick={(event) => {
            setInputValue(input);
          }}
          class="btn-search"
        ></button>
      </div>
    </main>
  );
};

export default Search;
